import React from 'react';
import { Link } from 'react-router-dom';
import { useTranslation } from "react-i18next";

import Darkmode from './Darkmode/Darkmode';
import Selector from '../components/Language/Selector';

function Navbar() {
    const { l } = useTranslation();
    return (
        <div className='navbar'>
            <ul className='navbar-list'>
                <li className='link'><Link to='/'>{ l ("main")}</Link></li>
                <li className='link'><Link to='/about'>{ l ("about")}</Link></li>
                <li className='link'><Link to='/recipes'>{ l ("recipes")}</Link></li>
                <li className='link'><Darkmode /></li>
                <li><Selector /></li>
            </ul>
        </div>
    );
}

export default Navbar;
